const r=async o=>{o.preventDefault();const a=document.querySelector("#login-form"),e=new FormData(a);console.log(e);const s=e.get("password"),i=e.get("email");if(!s||!i){alert("Please fill in form");return}const n=await fetch("https://c0dinex.onrender.com/api/v1/signin",{method:"POST",headers:{"Content-Type":"application/json"},body:JSON.stringify({password:e.get("password"),email:e.get("email")})});if(n.ok){const t=await n.json();console.log(t.data),localStorage.setItem("user",JSON.stringify(t.data)),window.location.replace("/")}else{const t=await n.text();alert(t)}};setInterval(()=>{document.getElementById("signIn").addEventListener("click",r)},3e3);
